are relatively constant, it is possible to estimate the amount of VLDL cholesterol by dividing the triglyceride value (in mg/dL) by 5.','en',1,'2006-06-02 16:01:56',NULL,NULL,'be9b4114-1691-11df-97a5-7038c432aabf'),(1293,1299,'To diagnose pancreatitis or other pancreatic diseases','en',1,'2006-06-05 16:00:46',NULL,NULL,'be9b427c-1691-11df-97a5-7038c432aabf'),(1294,1300,'Descriptive term:  open to two or more interpretations; or of uncertain nature or significance.','en',1,'2006-06-05 16:54:12',NULL,NULL,'be9b43a3-1691-11df-97a5-7038c432aabf'),(1295,1301,'Descriptive term:  to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 16:55:42',NULL,NULL,'be9b44c6-1691-11df-97a5-7038c432aabf'),(1296,1302,'Descriptive term:  unable to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 16:56:49',NULL,NULL,'be9b45e0-1691-11df-97a5-7038c432aabf'),(1297,1303,'Descriptive term:  restrictive of action.','en',1,'2006-06-05 16:58:56',NULL,NULL,'be9b4703-1691-11df-97a5-7038c432aabf'),(1298,1305,'This is a qualitative result for the number of copies/ml of DNA/RNA in patients with HIV.','en',1,'2006-06-05 17:21:15',NULL,NULL,'be9b4821-1691-11df-97a5-7038c432aabf'),(1299,1306,'Descriptive Term:  beyond detectable limit.','en',1,'2006-06-05 17:21:15',NULL,NULL,'be9b4940-1691-11df-97a5-7038c432aabf'),(1300,1307,'Mean platelet volume (MPV) is a machine-calculated measurement of the average size of your platelets. New platelets are larger, and an increased MPV occurs when increased numbers of platelets are being produced. MPV gives your doctor information about platelet production in your bone marrow.','en',1,'2006-06-06 13:04:02',NULL,NULL,'be9b4a5a-1691-11df-97a5-7038c432aabf'),(1301,1308,'A measurement derived from the platelet count and the mean platelet volume.','en',1,'2006-06-06 13:28:24',NULL,NULL,'be9b4b81-1691-11df-97a5-7038c432aabf'),(1302,1309,'Derived from direct flow cytometric measurement of platelet cell volume, it is increased in the presence of platelet anisocytosis.','en',1,'2006-06-06 13:30:28',NULL,NULL,'be9b4ca4-1691-11df-97a5-7038c432aabf'),(1303,1310,'Percentage of t-cells which express the CD3 surface receptor.','en',1,'2006-06-06 14:09:55',NULL,NULL,'be9b4dbe-1691-11df-97a5-7038c432aabf'),(1304,1318,'Quantitative cut-off result for initial HIV screening test','en',1,'2006-06-06 15:21:45',NULL,NULL,'be9b4ee1-1691-11df-97a5-7038c432aabf'),(1305,1319,'Immunology Test - CD45 plus lymphocyte count.','en',1,'2006-06-06 16:46:57',NULL,NULL,'be9b5000-1691-11df-97a5-7038c432aabf'),(1306,1326,'Qualitative interpretation of rapid HIV screening test 2.','en',1,'2006-06-07 13:35:57',NULL,NULL,'be9b511e-1691-11df-97a5-7038c432aabf'),(1307,1327,'Help determine if the bone marrow is responding adequately to the body?s need for RBCs and to help determine the cause of and classify different types of anemia.\r\n\r\nReticulocyte (%) = [Number of Reticulocytes / Number of Red Blood Cells] X 100','en',1,'2006-06-09 13:59:11',NULL,NULL,'be9b523d-1691-11df-97a5-7038c432aabf'),(1308,1328,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ?m in diameter with varying size and shape.\r\n\r\n','en',1,'2006-06-09 14:10:36',NULL,NULL,'be9b5360-1691-11df-97a5-7038c432aabf'),(1309,1330,'Absolute neutrophil count (ANC) is a measure of the number of neutrophil granulocytes (also known as polymorphonuclear cells, PMN\'s, polys, granulocytes, segmented neutrophils or segs) present in the blood. Neutrophils are a type of white blood cell that fights against infection.\r\n\r\nANC = (%neutrophils + %bands) x WBC','en',1,'2006-06-09 14:13:05',NULL,NULL,'be9b5483-1691-11df-97a5-7038c432aabf'),(1310,1331,'A monocyte count is part of a complete blood count and is expressed by absolute numbers.  Increase a monocyte count include: - chronic inflammation - stress response - hyperadrenocorticism - immune mediated disease - pyogranulomatous disease - necrosis - red cell regeneration.\r\n','en',1,'2006-06-09 14:14:37',NULL,NULL,'be9b55a6-1691-11df-97a5-7038c432aabf'),(1311,1332,'Eosinophil granulocytes, commonly referred to as eosinophils (or less commonly as acidophils), are white blood cells that are responsible for combating infection by parasites in the body.\r\n\r\n','en',1,'2006-06-09 14:15:28',NULL,NULL,'be9b56c8-1691-11df-97a5-7038c432aabf'),(1312,1333,'Basophils are the least common of the granulocytes, representing about 0.5% to 1% of circulating leukocytes. ','en',1,'2006-06-09 14:16:22',NULL,NULL,'be9b57eb-1691-11df-97a5-7038c432aabf'),(1313,1334,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ?m in diameter with varying size and shape.  Measure in absolute count.','en',1,'2006-06-09 14:17:35',NULL,NULL,'be9b590a-1691-11df-97a5-7038c432aabf'),(1314,1336,'Type of white blood cell which forms an early line of defence against bacterial infections by using microscopic exam','en',1,'2006-06-09 14:21:12',NULL,NULL,'be9b5a2d-1691-11df-97a5-7038c432aabf'),(1315,1337,'Immature neutrophils with a crescent shaped nucleus, bands are normal in the circulation in small numbers. If there is a percentage increase of them, there is said to be a left shift. This may happen when an acute infection stimulates increased neutrophils production.  This is a microscopic exam.','en',1,'2006-06-09 14:23:03',NULL,NULL,'be9b5b50-1691-11df-97a5-7038c432aabf'),(1316,1338,'Agranulocytic leukocyte that normally makes up about 25% of the total white blood cell count but increases in the presence of infection.  This is a microscopic exam.','en',1,'2006-06-09 14:24:35',NULL,NULL,'be9b5c84-1691-11df-97a5-7038c432aabf'),(1317,1339,'Large, circulating, phagocytic white blood cells, having a single well-defined nucleus and very fine granulation in the cytoplasm. Monocytes constitute from 3 to 8 percent of the white blood cells in humans.  This is a microscopic exam.','en',1,'2006-06-09 14:26:12',NULL,NULL,'be9b5e4d-1691-11df-97a5-7038c432aabf'),(1318,1340,'A type of white blood cell found in vertebrate blood, containing cytoplasmic granules that are easily stained by eosin or other acid dyes.  This is a microscopic exam.','en',1,'2006-06-09 14:27:03',NULL,NULL,'be9b6079-1691-11df-97a5-7038c432aabf'),(1319,1341,'Type of leukocyte, with coarse granules that stain blue when exposed to a basic dye. Basophils normally constitute 1% or less of the total white blood cell count but may increase or decrease in certain diseases.  This is a microscopic exam.','en',1,'2006-06-09 14:27:53',NULL,NULL,'be9b62a5-1691-11df-97a5-7038c432aabf'),(1320,1342,'Body Mass Index (BMI) is a relationship between weight and height that is associated with body fat and health risk.\r\n\r\nThe equation is BMI = body weight in kilograms/height in meters squared.','en',1,'2006-07-13 10:37:13',NULL,NULL,'be9b648d-1691-11df-97a5-7038c432aabf'),(1321,1343,'MUAC is the circumference of the left upper arm, measured at the mid-point between the tip of the shoulder and the tip of the elbow.  MUAC is useful for the assessment of nutritional status.','en',1,'2006-07-13 10:44:33',NULL,NULL,'be9b6670-1691-11df-97a5-7038c432aabf'),(1322,1344,'Anatomic location.','en',1,'2006-07-13 10:53:18',NULL,NULL,'be9b6854-1691-11df-97a5-7038c432aabf'),(1323,1345,'Anatomic location.','en',1,'2006-07-13 10:56:51',NULL,NULL,'be9b6a59-1691-11df-97a5-7038c432aabf'),(1324,1346,'Anatomic location.','en',1,'2006-07-13 11:00:37',NULL,NULL,'be9b6c16-1691-11df-97a5-7038c432aabf'),(1325,1347,'Anatomic location.\r\n','en',1,'2006-07-13 11:04:42',NULL,NULL,'be9b6ddb-1691-11df-97a5-7038c432aabf'),(1326,1348,'Anatomic location.','en',1,'2006-07-13 11:08:44',NULL,NULL,'be9b6f98-1691-11df-97a5-7038c432aabf'),(1327,1349,'Anatomic location.','en',1,'2006-07-13 11:36:06',NULL,NULL,'be9b7159-1691-11df-97a5-7038c432aabf'),(1328,1350,'Anatomic location.','en',1,'2006-07-13